import uniqid from "uniqid";
import React from "react";

const Overview = (props) => {
  return (
    <div>
      {props.tasks.map((item) => (
        <div key={uniqid()}>
          <span>
            {item.id}. {item.task}|||
          </span>

          <button onClick={()=>{props.deleteFunction(item.id)}}>Delet</button>
        </div>
      ))}
    </div>
  );
};

export default Overview;
